import Card from '../../presentational/molecules/card';

function Bord(props) {

  const style = {
    background: "gray"
  };

  return (
    <div className="col s4 m4" style={style}>
      <Card />
      <Card />
      <Card />
      <Card />
    </div>
  );
}

export default Bord;
